import React, { useEffect, useState } from "react";

export default function AddProject() {
  return (
    <form>
      <div className="login-form-content">
        <div>
          <button type="submit" className="add-project-btn">
            Ajouter le projet
          </button>
        </div>
      </div>
    </form>
  );
}
